import { Fragment, FunctionComponent } from "react";
import { NavBar } from "../component/NavBar";

export interface IHomePageProps{};

export const Homepage: FunctionComponent<IHomePageProps> = (props) => {
  const imageLink = "https://www.isoftstoneinc.com/wp-content/uploads/2020/03/iss_logo_light.png";
return(
  <Fragment>
    <div>
      <NavBar />
      <div>
        <img src={imageLink} alt={"isoftstone"} width="100px" height="50px"/>
      </div>
      <h1>This is the homepage</h1>
    </div>
  </Fragment>
)
}
